import {  Form } from "react-bootstrap"

export default function Registration () {
    return (
        <Form>
            <Form.Group className="mb-3" controlId="hc-reg-patient-name">
                <Form.Label>Please complete the registration form below</Form.Label>
                <Form.Control size="sm" type="text" placeholder="Patient Full Name (First/Last)" />
                <Form.Control size="sm" type="number" placeholder="NPI Number" />
                <Form.Control size="sm" type="text" placeholder="Phone Number" />
                <Form.Control size="sm" type="email" placeholder="Email Address" />
            </Form.Group>
        </Form>
    );
}
